- proto: PaperOffice
  entities:
  - uid: 253
    components:
    - type: Transform
      pos: -6.3820004,-6.3900075
      parent: 1
    - type: Paper
      content: >-
        [head=1] Deep Space Surrender![/head]


        [head=2]SCORING          [/head]

        1 = 100  
        5 = 50  
        Three 1’s = 1,000 
        Three 2’s = 200 
        Three 3’s = 300 
        Three 4’s = 400 
        Three 5’s = 500 
        Three 6’s = 600  
        1-2-3-4-5-6 = 3000 
        3 Pairs = 1500 (including 4-of-a-kind and a pair) 
        Four of a kind = Double the 3-of-a-kind value  
        Five of a kind = Triple the 3-of-a-kind value  
        Six of a kind = Quadruple the 3-of-a-kind value


        [bold]Gameplay and Rules![/bold]

        One player is chosen to begin and play moves clockwise around the table.


        Each player in turn rolls all six six-sided dice and checks to see if they have rolled any scoring dice or combinations. (See Scoring below.) Any dice that score may be set aside and then the player may choose to roll all the remaining dice. The player must set aside at least one scoring die of their choice if possible but is not required to set aside all scoring dice. 


        For example, if a player rolled 1-2-2-5-5-6 on their turn, they could set aside the 1 and the two 5's, or they could choose to set aside only the two 5's, or only a single 5, or only the 1.


        Any scoring dice that are not set aside may be rerolled along with the non-scoring dice.


        [bold]Hot Dice[/bold]

        If all six dice have been set aside for scoring (known as having “hot dice”), the player MUST roll all six dice again and continue adding to their accumulated score or they can bank their points, end their turn, and pass the dice to the next player. 


        A player’s turn continues until either they decide to stop (at which point they then score their accumulated points) or until they fail to roll any scoring dice on a throw.


        [bold]Surrender[/bold]

        If a player scores no points on a roll, this is known as a Surrender. The player may continue to roll any dice that have not been previously set aside for scoring, but all of their points gained so far that turn are lost.


        At the end of a player’s turn, any points they have scored are written down and the dice are passed to the next player.  

        [bold]First Round 500[/bold]

        On each players first turn, they must continue throwing the dice until they have scored at least 500 points or until they Surrender. Once they have reached the 500 points, they are free to continue rolling or end their turn.


        [bold]Winning[/bold] 

        A player must score exactly 2,750. If they get triplets or better they MUST take those points. If they go over it counts as a surrender and all their points are lost.


        By the Chief Engineer of this Station Lorfa Blemke!

        Have some fun with it!
